import logo from '../assets/pics/ticket.png';
import airport from '../assets/pics/airport.svg';
import travelTogether from '../assets/pics/travel_together.svg';
import travelBooking from '../assets/pics/travel_booking.svg';
import notFound from '../assets/pics/not_found.svg';
import aseman from '../assets/pics/logos/Aseman.png';
import kishAir from '../assets/pics/logos/Kish_Air.png';
import saha from '../assets/pics/logos/Saha.png';
import zagros from '../assets/pics/logos/Zagros.png';

export default {
    logo,
    airport,
    travelTogether,
    travelBooking,
    notFound,
    aseman,
    kishAir,
    saha,
    zagros,
}
